"use strict";(self.webpackChunkdigital_garden=self.webpackChunkdigital_garden||[]).push([[32439],{67408:i=>{i.exports=JSON.parse('{"label":"tools","permalink":"/docs/tags/tools","allTagsPath":"/docs/tags","count":6,"items":[{"id":"Food/Equipment","title":"Equipment","description":"In this article, I list the most important tools I use in the kitchen.  My philosophy for tools can be found in the tools section [[Tools]]","permalink":"/docs/Food/Equipment"},{"id":"Iphone/Iphone","title":"Iphone","description":"-","permalink":"/docs/Iphone/"},{"id":"Obsidian/Obsidian","title":"Obsidian","description":"Obsidian is where I store my knowledge. I use it as a tool for writing, for storing information and knowledge, and for remembering. The main point of using obsidian is that it is living on your personal computer, can be treated as a good tool for writing quickly and also can be integrated with a lot of different tools, which probably is a huge advantage.","permalink":"/docs/Obsidian/"},{"id":"Tools/ChatGPT","title":"OpenAI","description":"GPT-4 is one of the best tools I have used in the last couple of years. It is astonishing technology that makes me more productive.","permalink":"/docs/Tools/ChatGPT"},{"id":"Tools/Tools","title":"Tools","description":"Tools are the things I use to accomplish tasks. A tool can both be a requirement and a supplement to myself.","permalink":"/docs/Tools/"},{"id":"Mac/Terminal","title":"Warp","description":"I started using Warp in May 2022, and it quickly became my terminal of choice. I find the most difficult thing when using the terminal is that it is often difficult to remember commands even though I \\"know\\" what I want to do. Warp is amazing at solving this gap by using AI capabilities and natural language to make doing terminal tasks easier.","permalink":"/docs/Mac/Terminal"}],"unlisted":false}')}}]);